import { CardContent, Typography } from '@mui/material';
import Card from '@mui/material/Card';

const Dashboard = ()=>{
    return (
        <div>
            <Card>
            <CardContent>
                <Typography></Typography>
            </CardContent>
            </Card>
        </div>
    )
}

export default Dashboard;
